*,
::before,
::after {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

html,
body {
  width: 100vw;
  font-family: "montserrat", sans-serif;
  background-color: #f4f4f4;
  color: #141414;
  position: relative;
  display: flex;
  justify-content: center;
  overflow-x: hidden;
}

.GroundZero {
  max-width: 1920px;
  display: flex;
  justify-content: center;
  position: relative;
}

.Content_Wrap {
  width: 70%;
  margin-top: 100px;
  z-index: 20;
  position: relative;
}

a {
  text-decoration: none;
  color: #141414;
}

ul {
  list-style-type: none;
}

@media screen and (max-width: 1100px) {
  .Content_Wrap {
    width: 100%;
    padding: 0 80px;
  }
}
@media screen and (max-width: 700px) {
  .Content_Wrap {
    width: 100%;
    padding: 0 30px;
  }
}

// BASE ------------------------------------

//*
//*
//*
//*
//*
//*
//*
//*
//*
//*

// NAV ------------------------------------

.Header {
  position: fixed;
  width: 100%;
  max-width: 1920px;
  height: 170px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 0 80px;
  z-index: 1000;
  transition: all 0.4s ease-in;
}
.MobileHeader {
  z-index: 1002;
  display: none;
  opacity: 1;
  transition: opacity;
}

.SiteLogo {
  height: 100%;
  font-size: 24px;
  font-family: uppercut-angle, sans-serif;
  font-weight: 400;
  font-style: normal;
  display: flex;
  justify-content: center;
  align-items: center;
  white-space: nowrap;
}
.MobileSiteLogo {
  color: #fff;
}

.Header_Nav {
  display: flex;
  align-items: center;
  justify-content: space-between;
}

.Nav_Link {
  font-size: 20px;
  margin-right: 55px;
  font-weight: 500;
  transition: color 0.3s ease-in;
}
.Nav_Link:last-child {
  margin: 0;
}

.Nav_Link:hover {
  color: #1636fc;
}

.Nav_Link-ActivePage {
  color: #1636fc;
}

.MobileMenuIcon {
  width: 40px;
  height: 13px;
  display: none;
  flex-direction: column;
  align-items: center;
  justify-content: space-between;
  cursor: pointer;
}
.MobileMenuIcon-Active {
  width: 32px;
  justify-content: center;
  position: relative;
}

.MenuIconBar {
  width: 100%;
  height: 2px;
  background-color: #141414;
}
.Mobile-MenuIconBar1 {
  background-color: #fff;
  transform: rotate(45deg);
  position: absolute;
}
.Mobile-MenuIconBar2 {
  background-color: #fff;
  transform: rotate(-45deg);
  position: absolute;
}

@media screen and (max-width: 1600px) {
  .Header {
    height: 120px;
  }
  .SiteLogo {
    font-size: 20px;
  }
  .Nav_Link {
    font-size: 16px;
  }
}

@media screen and (max-width: 1100px) {
  .Header_Nav {
    display: none;
  }
  .MobileMenuIcon {
    display: flex;
  }
}

@media screen and (max-width: 700px) {
  .Header {
    height: 90px;
    padding: 0 30px;
  }
}

//*
//*
//*
//*
//*
//*
//*
//*
//*
//*

// MOBILE NAV ------------------------------------
.MobileNav {
  width: 100%;
  height: 100%;
  background-color: #1636fc;
  position: fixed;
  z-index: 1001;
  display: none;
  opacity: 1;
  transition: opacity;
}

.MobileNav_Wrap {
  width: 100%;
  height: 100%;
  position: relative;
  padding-left: 80px;
  padding-top: 80px;
  display: flex;
  align-items: center;
  transition: all 0.3s ease-in;
}

.MobileNav_Links {
  display: flex;
  flex-direction: column;
}

.MobileNav_ListItem {
  margin-bottom: 25px;
}

.MobileNav_link {
  font-size: 60px;
  font-weight: 900;
  color: #fff;
  transition: font-size 0.3s ease-in;
}
.MobileNav_link:last-child {
  margin-bottom: 0;
}

@media screen and (max-width: 700px) {
  .MobileNav_Wrap {
    padding-left: 30px;
  }
}

@media screen and (max-width: 500px) {
  .MobileNav_Wrap {
    padding-top: 60px;
  }
  .MobileNav_link {
    font-size: 50px;
  }
}

@media screen and (max-height: 700px) {
  .MobileNav_Wrap {
    padding-top: 60px;
  }
  .MobileNav_link {
    font-size: 40px;
  }
}

@media screen and (max-height: 500px) {
  .MobileNav_Wrap {
    padding-top: 100px;
  }
  .MobileNav_link {
    font-size: 32px;
  }
}

//*
//*
//*
//*
//*
//*
//*
//*
//*
//*

// FOOTER ------------------------------------
.Footer {
}

//*
//*
//*
//*
//*
//*
//*
//*
//*
//*

// CONSTANTS ------------------------------------
.Constants {
  width: 100%;
  height: 100%;
  position: fixed;
  z-index: 10;
}

//Fixed Left --------
.Constants_LeftFixed {
  width: 80px;
  height: 100%;
  position: fixed;
  top: 0;
  left: 0;
  bottom: 0;
}

.Constants_LeftFixedWrap {
  width: 100%;
  height: 100%;
  padding: 60px 0;
  position: relative;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: flex-end;
}

.Constants_LeftFixed-AddressWrap {
  transform: rotate(-90deg);
  white-space: nowrap;
}

.Constants_LeftFixed-Address {
  font-size: 11px;
  font-weight: 500;
  letter-spacing: 1px;
  text-transform: uppercase;
}

.Constants_LeftFixed-Socials {
  margin-top: 270px;
}

.Social1 {
  margin-bottom: 20px;
}

//Center Logo
.Constants-Logo {
  font-size: 60px;
  font-family: uppercut-angle, sans-serif;
  font-weight: 400;
  font-style: normal;
  color: rgb(255, 255, 255);
  white-space: nowrap;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  transition: font-size 0.4s ease-in;
}

//Connect Icon
.Constants-ConnectIcon {
  width: 60px;
  height: 60px;
  background-color: #1636fc;
  position: fixed;
  bottom: 60px;
  right: 50px;
  display: flex;
  justify-content: center;
  align-items: center;
  box-shadow: 5px 5px 10px rgba(22, 53, 252, 0.2);
  cursor: pointer;
  transition: padding-top;
}

@media screen and (max-height: 700px) {
  .Constants_LeftFixed-Socials {
    margin-top: 140px;
  }
}

@media screen and (max-height: 500px) {
  .Constants_LeftFixed {
    display: none;
  }
}

@media screen and (max-width: 1100px) {
  .Constants_LeftFixed {
    display: none;
  }
  .Constants-ConnectIcon {
    display: none;
  }
}

@media screen and (max-width: 700px) {
  .Constants-Logo {
    font-size: 40px;
  }
}

@media screen and (max-width: 500px) {
  .Constants-Logo {
    font-size: 32px;
  }
}
